import React, { useState } from 'react';
import {
    Box,
    TextField,
    Button,
    Grid,
    Typography,
    FormControl,
    Select,
    MenuItem,
    InputLabel,
} from '@mui/material';

const EditarHito = ({ hito, onSubmit, onCancel }) => {
    const [titulo, setTitulo] = useState(hito?.nombre_hito || '');
    const [descripcion, setDescripcion] = useState(hito?.descripcion || '');
    const [fechaInicio, setFechaInicio] = useState(hito?.fecha_inicio?.split('T')[0] || '');
    const [fechaFin, setFechaFin] = useState(hito?.fecha_fin?.split('T')[0] || '');
    const [estado, setEstado] = useState(hito?.estado || 'Pendiente');

    const handleSubmit = (e) => {
        e.preventDefault();
        const updatedHito = {
            id_hito: hito.id_hito,
            titulo,
            descripcion,
            fechaInicio,
            fechaFin,
            estado,
        };
        onSubmit(updatedHito);
    };

    return (
        <Box sx={{ padding: 3 }}>
            <Typography variant="h6" gutterBottom>
                Editar Hito
            </Typography>
            <form onSubmit={handleSubmit}>
                <Grid container spacing={2}>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Título del Hito"
                            value={titulo}
                            onChange={(e) => setTitulo(e.target.value)}
                            required
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Descripción"
                            value={descripcion}
                            onChange={(e) => setDescripcion(e.target.value)}
                            required
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Fecha de Inicio"
                            type="date"
                            InputLabelProps={{ shrink: true }}
                            value={fechaInicio}
                            onChange={(e) => setFechaInicio(e.target.value)}
                            required
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Fecha de Finalización"
                            type="date"
                            InputLabelProps={{ shrink: true }}
                            value={fechaFin}
                            onChange={(e) => setFechaFin(e.target.value)}
                            required
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <FormControl fullWidth>
                            <InputLabel>Estado</InputLabel>
                            <Select
                                value={estado}
                                onChange={(e) => setEstado(e.target.value)}
                                label="Estado"
                            >
                                <MenuItem value="Pendiente">Pendiente</MenuItem>
                                <MenuItem value="En Proceso">En Proceso</MenuItem>
                                <MenuItem value="Finalizado">Finalizado</MenuItem>
                            </Select>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Button
                            type="submit"
                            variant="contained"
                            color="primary"
                            fullWidth
                        >
                            Guardar Cambios
                        </Button>
                    </Grid>
                    <Grid item xs={12}>
                        <Button
                            onClick={onCancel}
                            variant="outlined"
                            color="secondary"
                            fullWidth
                        >
                            Cancelar
                        </Button>
                    </Grid>
                </Grid>
            </form>
        </Box>
    );
};

export default EditarHito;
